        <div class="reveal">
            <div class="slides"><section  data-markdown><script type="text/template">## Implement Authentication and Authorization To A Web Application

#### by [Thai Kha Le](#author) | [Applied Computing](#course) | [Network Security](#module)
</script></section><section  data-markdown><script type="text/template">
## Technologies and Background

- Backend: Go <!-- .element: class="fragment" -->
- Frontend: Elm <!-- .element: class="fragment" -->
- Authentication and Authorization: Auth0 (Auth0 SDK) <!-- .element: class="fragment" -->
  - OAuth - Authorization: <!-- .element: class="fragment" -->
      - 4 roles: Resource owner,  Resource server, Authorization server, and Client <!-- .element: class="fragment" -->
      - Used grant type due to app type: Implicit grant <!-- .element: class="fragment" -->
      - Access token <!-- .element: class="fragment" -->
  - OpenID Connect - Authentication: <!-- .element: class="fragment" -->
      - ID token <!-- .element: class="fragment" -->
  - Json Web Token <!-- .element: class="fragment" -->
      - Verification: format, signature (JWKS), claims, scopes <!-- .element: class="fragment" -->
  - Token renewal <!-- .element: class="fragment" -->
</script></section><section  data-markdown><script type="text/template">
## Practical work

- App idea: find free rooms in WIT <!-- .element: class="fragment" -->
- Setup Auth0: <!-- .element: class="fragment" -->
  - Client: <!-- .element: class="fragment" -->
      - Single page app <!-- .element: class="fragment" -->
      - Domain and ClientID -> Auth0 SDK <!-- .element: class="fragment" -->
  - API: <!-- .element: class="fragment" -->
      - Identifier (URL) <!-- .element: class="fragment" -->
      - Scope read:history <!-- .element: class="fragment" -->
- Scenarios: <!-- .element: class="fragment" -->
  - 1 - Initialization <!-- .element: class="fragment" -->
  - 2 - User login <!-- .element: class="fragment" -->
  - 3 - User already logged in <!-- .element: class="fragment" -->
  - 4 - Frontend sending requests to Backend <!-- .element: class="fragment" -->
  - 5 - Token renewal <!-- .element: class="fragment" -->
  - 6 - User logout <!-- .element: class="fragment" -->
</script></section><section  data-markdown><script type="text/template">

        <script src="./lib/js/head.min.js"></script>
        <script src="./js/reveal.js"></script>

        <script>
            function extend() {
              var target = {};
              for (var i = 0; i < arguments.length; i++) {
                var source = arguments[i];
                for (var key in source) {
                  if (source.hasOwnProperty(key)) {
                    target[key] = source[key];
                  }
                }
              }
              return target;
            }

            // Optional libraries used to extend on reveal.js
            var deps = [
              { src: './lib/js/classList.js', condition: function() { return !document.body.classList; } },
              { src: './plugin/markdown/marked.js', condition: function() { return !!document.querySelector('[data-markdown]'); } },
              { src: './plugin/markdown/markdown.js', condition: function() { return !!document.querySelector('[data-markdown]'); } },
              { src: './plugin/highlight/highlight.js', async: true, callback: function() { hljs.initHighlightingOnLoad(); } },
              { src: './plugin/zoom-js/zoom.js', async: true },
              { src: './plugin/notes/notes.js', async: true },
              { src: './plugin/math/math.js', async: true }
            ];

            // default options to init reveal.js
            var defaultOptions = {
              controls: true,
              progress: true,
              history: true,
              center: true,
              transition: 'default', // none/fade/slide/convex/concave/zoom
              dependencies: deps
            };

            // options from URL query string
            var queryOptions = Reveal.getQueryHash() || {};

            var options = {};
            options = extend(defaultOptions, options, queryOptions);
        </script>


        <script>
            Reveal.initialize(options);
        </script>
